INSERT IGNORE INTO `spplusnas_industry_infos` (`id`, `code`, `title_zh_cn`, `industry_infos`, `sector_infos`, `infos_zh_cn`, `LastTime`) VALUES
	(1, 'AAPL', '苹果', 'Consumer Electronics', 'Technology', '苹果公司，原称苹果电脑公司，是总部位于美国加州库比蒂诺的跨国科技公司，与亚马逊，谷歌、微软、Meta合称为五大科技巨擘。现时的业务包括设计、开发、手机通信和销售消费电子、计算机软件、在线服务和个人计算机。\n该公司最著名的硬件产品有iPhone智能手机、iPad平板电脑、Mac个人电脑、iPod音乐播放器、Apple Watch智能手表、Apple TV媒体播放器、AirPods无线耳机和HomePod智能音箱、游戏机Pippin atmark ；软件有macOS、iOS、iPadOS、watchOS和tvOS五大操作系统、iTunes播放器、Safari网页浏览器、Shazam音乐识别，还有iLife和iWork创意和生产力包，以及Final Cut Pro、Logic Pro和Xcode等专业软件；在线服务有iTunes Store、iOS App Store、Mac App Store、Apple Music、Apple TV+、iMessage和iCloud。苹果公司还有其他一系列服务包括Apple Store、Genius Bar、AppleCare、Apple Pay、Apple Pay Cash和Apple Card等。\n1976年4月，史蒂夫·乔布斯、斯蒂夫·沃兹尼亚克和罗纳德·韦恩创立了苹果公司，目的是为了开发和销售沃兹尼亚克Apple I个人电脑，但韦恩12天后就放弃了自己的股份。1977年1月，正式确定公司名称为苹果电脑公司，包括Apple II在内的电脑销量迅速增长。几年之内，乔布斯和沃兹尼亚克就雇佣了一批电脑设计师，并拥有了一条生产线。1980年，苹果公司上市，迅速获得了财务上的成功。在接下来的几年里，苹果公司推出了具有图形用户界面的新电脑，如1984年推出的Macintosh 128K，同时苹果公司的产品营销广告得到广泛好评。然而，其产品的高价格和有限的应用程序引发了许多问题，其高管之间的权力斗争不断。1985年，沃兹尼亚克离开了苹果公司，继续担任名誉雇员，而乔布斯和其他人则辞职成立了NeXT公司。\n2018财年，苹果公司全球总收入总计2,650亿美元。按收入计算，苹果是全球最大的科技公司，也是全球市值最高的公司之一。它也是仅次于三星的世界第二大手机制造商。2018年8月，苹果成为第一家市值超过1万亿美元的美国上市公司，两年后的2020年8月，它成为了第一家市值达到2万亿美元的美国公司，2022年1月，它成为了第一家市值达到3万亿美元的公司。 截至2020年，苹果公司拥有13.7万名全职员工，在25个国家拥有510家零售店。截至2020年1月，全球约有15亿件苹果产品在被活跃使用中。苹果公司还拥有很高的品牌忠诚度，并被评为世界最具价值品牌。但是，苹果公司在其产业链中的劳工制度、环境和商业实践中至今仍然饱受抨击。 ', '2022-04-14 21:54:17'),
	(2, 'A', '', 'Diagnostics & Research', 'Healthcare', '', '2022-04-14 21:54:34'),
	(3, 'AAL', '美国航空集团', 'Airlines', 'Industrials', '美国航空集团公司是美国一家总部位于德克萨斯州沃斯堡的航空业上市公司。美国航空集团成立于2013年12月9日，由美国航空的母公司AMR公司与全美航空的母公司全美航空集团合并而成。 美国航空集团是目前全球最大的航空公司，每天约有6,700多架次的航班飞往全球56个国家或地区的350个目的地，年营业收入超过400亿美元，并拥有超过10万人的雇员。美国航空集团且计划接受607架新飞机，这其中包括517架窄体飞机和90架宽体国际飞机。 美国联邦航空管理局于2015年4月8日为美国航空集团公司颁发了单一运营证书，这标志着美国航空与全美航空的合并最终完成。 ', '2022-04-14 21:54:49'),
	(4, 'AAP', '', 'Specialty Retail', 'Consumer Cyclical', '', '2022-04-14 21:55:05'),
	(5, 'ABBV', '', 'Drug Manufacturers—General', 'Healthcare', '', '2022-04-14 21:55:20'),
	(6, 'ABC', '', 'Medical Distribution', 'Healthcare', '', '2022-04-14 21:55:34'),
	(7, 'ABMD', 'ABIOMED, Inc.', 'Medical Devices', 'Healthcare', 'Abiomed is a publicly-traded medical devices company that develops and manufactures external and implantable circulatory support devices. The company is headquartered in Danvers, Massachusetts and has three additional offices, two in Germany in the cities of Berlin and Aachen, and another in Tokyo, Japan. Michael R. Minogue is Chairman, CEO &amp; President of the company, with Dr. Thorsten Siess as Chief Technology Officer, Dr. Chuck Simonton as Chief Medical Officer and Dr. David M. Weber as Chief Operating Officer. According to Bloomberg, the company &quot;engages in the research, development, and sale of medical devices to assist or replace the pumping function of the failing heart. It also provides continuum of care to heart failure patients&quot;. As of 2019, the company had secured five FDA approvals and 715 patents with 622 pending. For fiscal year 2019, Abiomed reported $769.4 million in revenue and reported diluted earnings per share was $5.61 for the year. ', '2022-04-14 21:55:48'),
	(8, 'ABT', '', 'Medical Devices', 'Healthcare', '', '2022-04-14 21:56:00'),
	(9, 'ACN', '', 'Information Technology Services', 'Technology', '', '2022-04-14 21:56:17'),
	(10, 'ADBE', 'Adobe', 'Software—Infrastructure', 'Technology', 'Adobe公司，是美国一家跨国电脑软件公司，总部位于加州的圣何塞，其官方大中华部门内也常以中文“奥多比”自称。主要从事多媒体制作类软件的开发，近年亦开始涉足丰富互联网应用程序、市场营销应用程序、金融分析应用程序等软件开发。 ', '2022-04-14 21:56:32'),
	(11, 'ADI', '亚德诺半导体', 'Semiconductors', 'Technology', '亚德诺半导体技术有限公司是一家财富500强美国的跨国半导体装置生产商。亚德诺半导体技术有限公司专为消费与工业产品制造ADC、DAC、MEMS与DSP芯片。他们目前正在设计大小范围为65奈米到3微米的电路。\n亚德诺半导体技术有限公司现今于全球雇用了15,300名雇员。2017年财政年度收入为51亿美元。 ', '2022-04-14 21:56:47'),
	(12, 'ADM', '', 'Farm Products', 'Consumer Defensive', '', '2022-04-14 21:57:04'),
	(13, 'ADP', 'ADP', 'Staffing & Employment Services', 'Industrials', '自动资料处理公司，通常称ADP或安德普翰，是世界最大的人力资源管理公司之一。 ', '2022-04-14 21:57:21'),
	(14, 'ADS', '', '', '', '', '2022-04-14 21:57:35'),
	(15, 'ADSK', 'Autodesk', 'Software—Application', 'Technology', '欧特克股份有限公司是一家美国公司，以其在建筑、工程及制造业等行业的产品闻名。欧特克系由约翰·沃克和另外12个人一起在1982年所创建。在美国的马林县亦设有多个分公司，而目前则以圣拉菲尔为总部。位于中国上海的欧特克中国研究院是欧特克全球最大的研发机构。 ', '2022-04-14 21:57:52'),
	(16, 'AEE', '', 'Utilities—Regulated Electric', 'Utilities', '', '2022-04-14 21:58:18'),
	(17, 'AEP', '美国电力公司', 'Utilities—Regulated Electric', 'Utilities', '美国电力公司是美国一家主要的公共事业控股能源公司。在2020年2月，其电力服务输送范围覆盖十一个美国州份超过五百万个客户。\n美国电力公司以发电量计为全美国发电量最大的电力供应商，其拥有发电设施的发电容量近38,000兆瓦。美国电力公司同时拥有全美国最庞大的输电网络，覆盖近39,000-英里的范围，包括操作电压在超高压的765kV的输电网，超过全美国其余输电网络长度的总和。 美国电力公司的输电系统直接或间接地提供服务予东部电力联网大约百份之十的电力需求量，覆盖38个美国东部及中部州份和加拿大东部，以及德克萨斯电力可靠性委员会，即大部分德克萨斯州输电网络约百份之十一的电力需求量。\n美国电力公司是首家使用345kV 高压输电系统的电力营运商。该输电系统始用于1953年。\n在2018年，美国电力公司以利润计于“财富美国500强”最大型美国企业排行第185位。 ', '2022-04-14 21:58:39'),
