	(24, 'AKAM', '阿卡迈科技', 'Software—Infrastructure', 'Technology', '阿卡迈科技是一家总部位于美国马萨诸塞州剑桥市的内容分发网络和云服务提供商，是世界上最大的分布式计算平台之一，承担了全球15-30%的网络流量。该公司经营着分布于世界各地的服务器网络，主要业务为出租服务器资源给那些希望通过从靠近用户的服务器来分发内容来提高自己网站访问速度的客户。\n多年来，该公司的客户已包括苹果公司、Facebook、微软、Twitter、TVB、国泰航空和healthcare.gov等。当用户浏览到Akamai客户的网站时，用户的浏览器将被重指向到Akamai服务器上的副本，以达到提速的目的，此操作对大部分客户而言完全透明。并且可降低遭分布式拒绝服务攻击的影响。\nAkamai是一个夏威夷语，意思是“智能”或“聪明”。 ', '2022-04-14 22:00:36'),
	(25, 'ALB', '', 'Specialty Chemicals', 'Basic Materials', '', '2022-04-14 22:00:52'),
	(26, 'ALGN', '爱齐科技', 'Medical Devices', 'Healthcare', '艾利科技，或译爱奇科技，是美国加州圣荷西的一家医疗设备制造商，主要生产畸齿矫正设备和3D数字扫描仪。隐适美是该公司旗下品牌，1998年获FDA批准，1999年在美国开始销售。2001年，公司在纳斯达克上市。 ', '2022-04-14 22:01:16'),
