	(33, 'AMD', '超微半导体', 'Semiconductors', 'Technology', '超微半导体公司，创立于1969年，是一家专注于微处理器及相关技术设计的跨国公司，总部位于美国加州旧金山湾区硅谷内的森尼韦尔市。最初，超微拥有晶圆厂来制造其设计的芯片，自2009年超微将自家晶圆厂拆分为现今的格芯以后，成为无厂半导体公司，仅负责硬件集成电路设计及产品销售业务。现时，超微的主要产品是中央处理器、图形处理器、主板芯片组以及电脑存储器。\n超微半导体是目前除了英特尔以外，最大的x86架构微处理器供应商，自收购冶天科技以后，则成为除了英伟达和将发布独立显卡的英特尔以外仅有的独立图形处理器供应商，自此成为一家同时拥有中央处理器和图形处理器技术的半导体公司，也是唯一可与英特尔和英伟达匹敌的厂商。在2017年第一季全球个人电脑中央处理器的市场占有率中，英特尔以79.8％排名第一、AMD以20.2％位居第二。于2017年8月，AMD CPU在德国电商Mindfactory的销售量首次以54.0%超越Intel，并于9月增长至55.0%，于10月，销售份额仍继续成长至57.7%，于11月，由于增加部分未计算型号，份额下降至57.4%。 ', '2022-04-14 22:03:19'),
	(34, 'AME', '', 'Specialty Industrial Machinery', 'Industrials', '', '2022-04-14 22:03:41'),
	(35, 'AMGN', '安进', 'Drug Manufacturers—General', 'Healthcare', '安进是一家美国制药公司，总部位于加州千橡市。它成立于1980年，经过多次兼并，成为世界最大的制药公司之一。 ', '2022-04-14 22:04:04'),
	(36, 'AMP', '', 'Asset Management', 'Financial Services', '', '2022-04-14 22:04:25'),
	(37, 'AMT', '', 'REIT—Specialty', 'Real Estate', '', '2022-04-14 22:04:42'),
	(38, 'AMZN', '亚马逊公司', 'Internet Retail', 'Consumer Cyclical', '亚马逊公司是一家总部位于美国西雅图的跨国电子商务企业，目前是全球最大的互联网线上零售商之一，也是美国《财富》杂志2016年评选的全球最大500家公司的排行榜中的第44名。亚马逊公司在2017年的财富500强企业里列第8位。\n亚马逊公司在美国、加拿大、英国、法国、德国、中国 、新加坡、意大利、西班牙、巴西、日本、印度、墨西哥、澳大利亚和荷兰均开设了零售网站，而其旗下的部分商品也会通过国际航运的物流方式销售往其他国家。波兰和瑞典等国也有望开设分站。\n2020年2月，亚马逊市值正式达到1兆美元，次于苹果公司、微软、Alphabet旗下谷歌，为第四家市值破兆美元的美国上市公司。 ', '2022-04-14 22:05:01'),
	(39, 'ANET', '', 'Computer Hardware', 'Technology', '', '2022-04-14 22:05:17'),
	(40, 'ANSS', 'ANSYS公司', 'Software—Application', 'Technology', 'ANSYS公司由John A. Swanson于1970年成立，其原名为“Swanson分析系统公司”。ANSYS公司总部位于美国宾夕法尼亚洲的匹兹堡，全球拥有40多个代理商和/或子公司。ANSYS及其子公司有5000多名员工，在40多个国家销售其产品。\nANSYS公司致力于工程模拟软件和技术的研发，其主要产品ANSYS在全球众多行业中被工程师和设计师广泛采用。ANSYS公司重点开发开放、灵活的，对设计直接进行仿真的解决方案，提供从概念设计到最终测试产品研发全过程的统一平台，同时追求快速、高效和和成本意识的产品开发。公司和其全球网络的渠道合作伙伴为客户提供销售、培训和技术支持一体化服务。 ', '2022-04-14 22:05:32'),
