	(44, 'APA', '阿帕奇公司', 'Oil & Gas E&P', 'Energy', 'APA Corporation is the holding company for Apache Corporation, an American company engaged in hydrocarbon exploration. It is organized in Delaware and headquartered in Houston. The company is ranked 595th on the Fortune 500. ', '2022-04-14 22:06:31'),
