	(48, 'ARE', '', 'REIT—Office', 'Real Estate', '', '2022-04-14 22:07:43'),
	(49, 'ASML', '阿斯麦', 'Semiconductor Equipment & Materials', 'Technology', '阿斯麦是在荷兰费尔德霍芬的半导体设备制造商。公司同时在欧洲和美国NASDAQ上市。有从业员工28,000多名。在世界16个国家和地区有提供服务。阿斯麦公司的主要产品是用于生产大规模集成电路的核心设备光刻机。在世界同类产品中有90％的市占率，在14纳米制程以下有100％的市占率。 ', '2022-04-14 22:07:58'),
	(50, 'ATO', '', 'Utilities—Regulated Gas', 'Utilities', '', '2022-04-14 22:08:12'),
	(51, 'ATVI', '动视暴雪', 'Electronic Gaming & Multimedia', 'Communication Services', '动视暴雪是一家位于美国加利福尼亚州圣莫尼卡市的电子游戏控股公司。此公司于2008年7月经由动视与维旺迪游戏两间公司合并所创立。动视暴雪在纳斯达克交易所底下以ATVI的代号交易，且从2005年起为标准普尔500指数的组成股票之一。动视暴雪目前由五个单位组成：动视发行、暴雪娱乐、King、MLG以及动视暴雪影业。\n动视暴雪在动视发行的旗下拥有并经营众多游戏工作室，其中包含Treyarch、Infinity Ward、High Moon Studios和Toys for Bob。动视暴雪制作的重大知识产权包含《使命召唤》、《古惑狼》、《吉他英雄》、《东尼·霍克》、《虐杀原形》、《小龙斯派罗》、《小龙斯派罗Skylanders》、《魔兽世界》、《星际争霸》、《暗黑破坏神》、《炉石传说》、《风暴英雄》、《守望先锋》与《糖果传奇》等。\n动视暴雪的游戏多次打破销售纪录。截至2018年3月，动视暴雪在收入与市场价值方面为欧美最大的游戏公司。\n2022年1月18日，微软宣布将以687亿美元收购动视暴雪。动视暴雪将成为Xbox游戏工作室的一员，同时让微软成为继腾讯游戏和索尼互动娱乐之后的第三大游戏公司。 ', '2022-04-14 22:08:27'),
	(52, 'AVB', '', 'REIT—Residential', 'Real Estate', '', '2022-04-14 22:08:40'),
	(53, 'AVGO', '博通有限', 'Semiconductors', 'Technology', '博通有限公司，前身为安华高科技，美国的无厂半导体公司，其业务内容广泛，在美国圣荷西设立总部。安华高科技创立于1961年，在2016年1月完成对博通的收购后，改名博通有限公司。 ', '2022-04-14 22:08:56'),
