	(65, 'BIDU', '百度', 'Internet Content & Information', 'Communication Services', '百度公司是一家主要经营搜索引擎服务的中国互联网公司，于2000年1月1日由李彦宏、徐勇两人创立于北京中关村。“百度”这个名字源自中国南宋词人辛弃疾的《青玉案·元夕》中的一句词：“众里寻他千百度，蓦然回首，那人却在，灯火阑珊处。”。百度的企业标志则是一个“熊掌”，有着“猎人以熊掌来寻迹”的意象。\n截止至2022年4月，百度在Alexa的排名上位于全球第四位，中国第一位，占全世界搜索引擎市场份额12.53％，目前百度在内容还有累积的优势，仍能保持相当比例，但是也已经开始转向服务型云端业务。 ', '2022-04-14 22:13:14'),
	(66, 'BIIB', 'Biogen', 'Drug Manufacturers—General', 'Healthcare', '渤健公司是一所位于美国麻塞诸塞州剑桥的生物科技公司，专门从事神经系统疾病、自体免疫性疾病和癌症药物的开发。建立于2003年，由Biogen 与 Idec 合并而成。 ', '2022-04-14 22:13:26'),
	(67, 'BK', '', 'Asset Management', 'Financial Services', '', '2022-04-14 22:13:40'),
	(68, 'BKNG', 'Booking Holdings', 'Travel Services', 'Consumer Cyclical', 'Booking Holdings，透过该集团旗下六个品牌：缤客、Priceline.com、雅高达、客涯、rentalcars.com以及OpenTable， 提供消费者与当地厂商旅游相关服务的线上供应商。Booking Holdings在总共超过200个以上的国家营运，并支援美洲、欧洲、亚洲、中东地区等超过40种语言。\nBooking Holdings的前身是Priceline集团，到2018年二月正式改名。 ', '2022-04-14 22:13:56'),
