	(72, 'BMRN', '拜玛林制药', 'Biotechnology', 'Healthcare', '拜玛林制药是一家总部位于美国加州圣拉菲尔的跨国制药公司，主要研究、生产酵素替代疗法相关药物。此公司发明的Aldurazyme是最早出现的I型黏多糖症治疗药物。\n该公司由克里斯托佛·斯塔尔和小格兰特·丹尼森创立于1997年，1999年上市。 ', '2022-04-14 22:14:57'),
