	(89, 'CDNS', 'Cadence', 'Software—Application', 'Technology', '益华电脑股份有限公司，或称铿腾电子，成立于1988年，是电子设计自动化软件与工程服务的重要厂商，主要提供集成电路设计、系统单片机、以及印刷电路板所需的软件工具与硅智财，涵盖模拟/数字/混合电路设计、验证、封装/PCB设计等各领域。 ', '2022-04-14 22:19:11'),
	(90, 'CDW', 'CDW', 'Information Technology Services', 'Technology', 'CDW公司是美国的一家科技公司，为商业、政府和教育机构提供信息技术产品和服务。2018年，它位列财富美国500强第189位。 ', '2022-04-14 22:19:25'),
