	(92, 'CERN', 'Cerner Corporation', 'Health Information Services', 'Healthcare', '塞纳公司 是一家美国卫生信息技术公司，提供卫生信息技术解决方案、服务以及设备。\n该公司成立1979年，称“PGI &amp; Associates”，1984年改现名，1986年上市，随后规模逐渐扩大。 ', '2022-04-14 22:19:55'),
