	(96, 'CHKP', 'Check Point', 'Software—Infrastructure', 'Technology', 'Check Point软件技术公司是以色列的一家科技公司，提供IT安全软件和硬件服务。公司的总部位于特拉维夫，并在加利福尼亚、瑞典、白俄罗斯设有开发中心。Check Point于1993年设立于拉马干，创始人包括Gil Shwed、Marius Nacht、Shlomo Kramer。 ', '2022-04-14 22:20:55'),
	(97, 'CHRW', '羅賓遜全球物流', 'Integrated Freight & Logistics', 'Industrials', 'C.H. Robinson is an American Fortune 500 provider of multimodal transportation services and third-party logistics. The company offers freight transportation, transportation management, brokerage and warehousing. It offers truckload, less than truckload, air freight, intermodal, and ocean transportation. ', '2022-04-14 22:21:08'),
	(98, 'CHTR', '特许通讯', 'Entertainment', 'Communication Services', '特许通讯公司是总部位于美国康涅狄格州斯坦福的一家通讯公司，“Spectrum”为其旗下商标。它是仅次于康卡斯特的美国第二大有线电视运营商。2016年5月18日收购时代华纳有线和光明屋网络之后，成为仅次于康卡斯特和AT&amp;T的第三大付费电视运营商。2018年财富美国500强中该公司名列第74。 ', '2022-04-14 22:21:25'),
	(99, 'CI', '', 'Healthcare Plans', 'Healthcare', '', '2022-04-14 22:21:42'),
	(100, 'CINF', 'Cincinnati Financial Corporation', 'Insurance—Property & Casualty', 'Financial Services', 'Cincinnati Financial Corporation offers property and casualty insurance, its main business, through The Cincinnati Insurance Company, The Cincinnati Indemnity Company and The Cincinnati Casualty Company. The company has 1.01% of the domestic property and casualty insurance premiums, which ranks it as the 20th largest insurance company by market share in the U.S.\nThe Cincinnati Insurance Company was founded in 1950 by four agents, including brothers John Jack Schiff and Robert Cleveland Schiff.\nThe Cincinnati Life Insurance Company markets life and disability income insurance and annuities. CFC Investment Company supports the insurance subsidiaries and their independent agent representatives through commercial leasing and financing activities. CinFin Capital Management Company provides asset management services to institutions, corporations and individuals.\nIn 2001, SFAS 133 adjustments were included with realized capital gains or losses rather than investment income. The impact on nine-month 2001 earnings was an after-tax gain of $1.3 million. Prior period 2001 results were restated on this basis. ', '2022-04-14 22:22:06'),
	(101, 'CL', '', 'Household & Personal Products', 'Consumer Defensive', '', '2022-04-14 22:22:22'),
