	(103, 'CMA', '', 'Banks—Regional', 'Financial Services', '', '2022-04-14 22:22:52'),
	(104, 'CMCSA', '康卡斯特', 'Entertainment', 'Communication Services', '通播集团，曾用名“康卡斯特控股公司”，是一家位于美国的全球通讯业综合企业集团；通过Xfinity品牌，其收入在全球电信及有线电视市场均位居第一。 通播集团同时是美国第二大付费电视服务商；第一大有线电视和家庭互联网接入服务商，以及第三大家庭电话服务商。康卡斯特集团在全美40个州和哥伦比亚特区提供商业服务。 康卡斯特集团的总部位于美国宾夕法尼亚州的费城。 自从2011年开始成为国际传媒集团NBC环球集团的所有者， 康卡斯特集团也成为院线、无线电视、有线电视等渠道的电影与电视节目提供商。\n康卡斯特集团拥有并运营Xfinity电讯和有线电视服务；全美无线电视联播网；多个有线电视频道；电影制片公司以及位于加利福尼亚州洛杉矶、佛罗里达州奥兰多和日本大阪的环球主题乐园及度假村。新加坡环球影城是康卡斯特集团运营的四大环球影城主题公园之一，但其所有权归云顶集团；而北京环球影城等新环球主题乐园和度假村也将在未来兴建或选址。 同时，康卡斯特集团在数字发行渠道方面也有诸多控股资产，例如在2006年收购的平台。2014年2月，康卡斯特集团与时代华纳有线达成一项价值452亿美元的股权置换协议。而根据这份协议，康卡斯特集团将最终全资拥有时代华纳有线公司。 但是到了2015年4月24日，康卡斯特集团终止了该协议。 康卡斯特集团在2017年6月与特许通信达成协议，将在晚些的时候就收购斯普林特进行独家谈判。\n康卡斯特集团因为多种理由而备受批评；其有线电视服务的客户满意度位居业界后列。 此外，康卡斯特集团过去曾违反网络中立性原则；尽管康卡斯特集团承诺恪守网络中立性的狭义定义， 但是批评人士指出这个定义无视了康卡斯特专用网络服务与康卡斯特其他网络接入服务之间的差别。 同时批评人士也指责康卡斯特的绝大多数服务地区缺乏竞争，有线电视服务商之间的竞争有限。 此外还考虑到康卡斯特集团作为互联网接入服务商巨头的谈判能力，康卡斯特集团极可能利用付费对等原则来不公平地影响终端用户的互联网接入速度。同时由于康卡斯特同时拥有内容的制作能力和分发能力，这也引发了业界有关“垄断”的担忧。这些以及其他问题导致康卡斯特集团在2010年和2014年两度成为消费者票选出来的“全美最差公司”。 ', '2022-04-14 22:23:08'),
	(105, 'CME', '芝加哥商业交易所', 'Financial Data & Stock Exchanges', 'Financial Services', '芝加哥商品交易所集团，简称芝商所，是一家全球公司。它是世界上最大的衍生性金融产品交易所。 ', '2022-04-14 22:23:24'),
