	(115, 'COST', '开市客', 'Discount Stores', 'Consumer Defensive', '开市客是全球第三大以及美国第一大连锁会员制零售型、仓储式量贩店，也是美国《财富》杂志2017年评选的第36名。1983年成立于美国华盛顿州西雅图市，最早起源于1976年的Price Club公司。开市客在全球十二个国家设有超过800家的分店，其中大部分都位于美国境内，加拿大则是最大国外市场。全球企业总部设于华盛顿州伊瑟阔，并在邻近的西雅图设有旗舰店。亚洲地区则会根据当地的习俗来，如位于台湾的开市客则在农历新年大年初一暂停营业及前一日除夕提前打烊。另外，美国的开市客在元旦、复活节、阵亡将士纪念日、美国独立日、劳动节、感恩节、圣诞节的节日均暂停营业。 ', '2022-04-14 22:26:10'),
	(116, 'COTY', '', 'Household & Personal Products', 'Consumer Defensive', '', '2022-04-14 22:26:25'),
	(117, 'CPB', '', 'Packaged Foods', 'Consumer Defensive', '', '2022-04-14 22:26:41'),
	(118, 'CPRT', 'Copart', 'Auto & Truck Dealerships', 'Consumer Cyclical', 'Copart, Inc. or simply Copart is a global provider of online vehicle auction and remarketing services to automotive resellers such as insurance, rental car, fleet and finance companies in 11 countries; the US, Canada, the UK, Germany, Ireland, Brazil, Spain, UAE, Bahrain, Oman and Finland. Headquartered in Dallas, Texas, Copart has more than 200 physical locations around the world, where it houses more than 10,000 acres of vehicle inventory. Copart sells used, wholesale and repairable vehicles in weekly and bi-weekly online auctions to buyers ranging from consumers to automotive businesses around the world. Copart provides vehicle sellers with a range of services to process and sell repairable and clean title vehicles over the internet, using its patented virtual auction technology, named VB3.\nCopart&#39;s brands include CashForCars.com, CrashedToys and National Powersport Auctions.\nCopart is a public company and is traded on the NASDAQ under the ticker symbol CPRT and has been named to Fortune’s 2020 Future 50 companies, 100 Fasted-Growing Companies, and the Fortune 500 list. ', '2022-04-14 22:26:55'),
	(119, 'CRM', '', 'Software—Application', 'Technology', '', '2022-04-14 22:27:08'),
	(120, 'CSCO', '思科系统', 'Communication Equipment', 'Technology', '思科系统是一间跨国际综合技术企业，总部设于加州硅谷。思科开发、制作和售卖网络硬件、软件、通信设备等高科技产品及服务，并透过子公司打入其他科技市场，比如物联网、域名安全、能源管理。公司成立于加州。\n2009年6月8日，道琼斯工业平均指数纳入了思科系统。除此之外，纳入思科的股价指数包括标准普尔500指数、罗素1000指数、纳斯达克100指数、罗素1000股价增长指数。\n思科成立于1984年，创始人是斯坦福大学的一对计算机科学家——列昂纳德·波萨克和桑德·勒纳。他们俩协助把斯坦福校园的计算机连接起来，并率先提出以支持多种协议的路由系统连接位于不同地理位置的电脑。1990年上市时，思科市值2.24亿美元，到了2000年互联网泡沫将近结束时，思科市值超过5,000亿美元。 ', '2022-04-14 22:27:20'),
	(121, 'CSGP', '科斯塔集團', 'Real Estate Services', 'Real Estate', 'CoStar Group is a Washington, DC-based provider of information, analytics and marketing services to the commercial property industry in the United States, Canada, the United Kingdom, France, Germany, and Spain. Founded in 1987 by Andrew C. Florance, the company has grown to include online database CoStar and many online marketplaces, including Apartments.com, LoopNet, Lands of America, and BizBuySell. ', '2022-04-14 22:27:34'),
	(122, 'CSX', 'CSX', 'Railroads', 'Industrials', 'CSX公司是一家美国铁路运输及房地产公司，1980年由Chessie System和Seaboard Coast Line Industries合并成立。两家公司旗下的铁路运输业务现由CSX公司的子公司CSX运输公司运营。\n其中，Seaboard System铁路公司由大西洋海岸线铁路公司创办。而大西洋海岸线铁路公司之前先后兼并了Seaboard Air Line铁路公司、Louisville and Nashville铁路公司和其它一些小的附属公司。1987年8月31日，Chesapeake and Ohio铁路公司合并到CSX，前者在同年的4月30曾经收购了Baltimore and Ohio铁路公司。这场合并早在1980年与Chessie System公司和Seaboard Coast Line公司合并时就已经开始。\n截止目前，CSX Corporation运营着大约19,500 英里的铁路网络，为密西西比河以东的23 个州、哥伦比亚特区以及加拿大安大略省和魁北克省的各个人口中心提供服务，并拥有和租赁大约3,539 辆机车。 ', '2022-04-14 22:27:47'),
	(123, 'CTAS', '信达思', 'Specialty Business Services', 'Industrials', '信达思公司，又译辛塔斯公司，是一家总部位于美国俄亥俄州辛辛那提的公司，除去销售制服外，也提供服装租赁、家政服务、急救和消防培训，主要服务地区为北美。 ', '2022-04-14 22:28:01'),
	(124, 'CTL', '', '', '', '', '2022-04-14 22:28:14'),
	(125, 'CTSH', '高知特', 'Information Technology Services', 'Technology', '高知特，是一家管理咨询、信息技术及业务流程外包服务供应商。总部位于新泽西州的提内克。是纳斯达克100指数和标准普尔500指数的成分股。 ', '2022-04-14 22:28:27'),
	(126, 'CTVA', '', 'Agricultural Inputs', 'Basic Materials', '', '2022-04-14 22:28:40'),
	(127, 'CTXS', '思杰系统', 'Software—Application', 'Technology', '思杰系统公司是一家软件和云端运算的科技公司。它的跨国业绩包括提供服务器、软件及桌面虚拟化、网络连结、以及软件即服务等产品。\n成立于1989年，目前为全世界约400,000家组织提供服务，当中包含了财富美国500强当中的98%企业，以及财富美国1000强当中的99%企业。总部位于美国佛罗里达州布劳沃德县劳德代尔堡。 ', '2022-04-14 22:28:55'),
