	(157, 'EA', '艺电', 'Electronic Gaming & Multimedia', 'Communication Services', '艺电是美国一家跨国性的互动娱乐软件制作与发行公司，由特里普·霍金斯于1982年5月28日创立，总部位于美国加利福尼亚州的红木城，在美国、加拿大、英国、澳大利亚、中国等地区均设有分公司或子公司，世界各地雇员总数超过9700人。主要进行电脑游戏、主机游戏、网络游戏、手机游戏等的开发、出版以及销售业务活动。 ', '2022-04-14 22:36:55'),
