	(176, 'EXC', '艾索伦电力公司', 'Utilities—Diversified', 'Utilities', '艾索伦电力公司是美国一家公共事业控股公司，也是美国目前最大的核电公司。其拥有10座发电厂，每年发电可达到1.8万兆瓦，占美国核电力发电量的20%。它的子公司主要针对住宅、商业、工业和批发顾客从事电力的生产、 购买、 传输、发行和销售。并同时针对住宅、商业和工业顾客从事分配和销售天然气业务。 ', '2022-04-14 22:41:55'),
	(177, 'EXPD', 'Expeditors International', 'Integrated Freight & Logistics', 'Industrials', 'Expeditors is an American worldwide logistics and freight forwarding company headquartered in Seattle, Washington. ', '2022-04-14 22:42:18'),
	(178, 'EXPE', '智游网集团', 'Travel Services', 'Consumer Cyclical', '智游网集团公司是一家线上旅游公司，旗下品牌包括Expedia.com、Hotels.com、Orbitz.com、Travelocity、Trivago、Hotwire.com、Egencia、Venere.com、HomeAway、Expedia本土专家、Classic Vacations。Expedia是纳斯达克上市公司，股票代码为EXPE。 ', '2022-04-14 22:42:35'),
