	(181, 'FANG', 'Diamondback Energy Inc', 'Oil & Gas E&P', 'Energy', 'Diamondback Energy is a company engaged in hydrocarbon exploration headquartered in Midland, Texas.\nAs of December 31, 2020, the company had 1,788 million barrels of oil equivalent of estimated proved reserves, of which 52% was petroleum, 24% was natural gas, and 24% was natural gas liquids. The company&#39;s reserves are all in the Permian Basin.\nIt is ranked 781st on the Fortune 500. ', '2022-04-14 22:43:25'),
	(182, 'FAST', '快扣', 'Industrial Distribution', 'Industrials', '快扣是一家美国工业和坚固件经销商，也提供存货管理和工具修复等服务。该公司创立于1967年，次年正式注册。21世纪初将业务拓展到北美其他国家及亚洲地区。 ', '2022-04-14 22:43:38'),
	(183, 'FB', 'Meta', 'Internet Content & Information', 'Communication Services', 'Meta Platforms, Inc.是美国一家经营社交网络服务、虚拟现实、元宇宙等产品的互联网科技公司，总部位于美国加州门洛帕克，旗下拥有Facebook、Instagram、WhatsApp等社交软件。它是由马克·扎克伯格和他的室友、哈佛学院的学生埃杜阿尔多·萨维林、安德鲁·麦科勒姆、达斯廷·莫斯科维茨和克里斯·休斯一起创立的，最初的名字是TheFacebook.com，后简化为Facebook，后于2021年10月28日由扎克伯格宣布改名为Meta。\nMeta提供社交网络服务之外的其他产品和服务，包括Facebook Messenger、Facebook Watch和Facebook Portal，之后陆续收购了Instagram、WhatsApp、Oculus、Giphy和Mapillary，并持有Jio Platforms9.9%的股份。\nMeta是全球最有价值的公司之一，与微软、亚马逊、苹果和Alphabet一起被认为是五大科技公司之一。\n“Meta”一词来自希腊语，意思是“Beyond”，表示未来主义的动机。 ', '2022-04-14 22:43:52'),
	(184, 'FBHS', '', 'Furnishings, Fixtures & Appliances', 'Consumer Cyclical', '', '2022-04-14 22:44:09'),
