	(188, 'FFIV', 'F5', 'Software—Infrastructure', 'Technology', 'F5网络公司又称F5公司，是一家专门从事应用层服务和应用交付网络的美国公司。F5公司总部位于华盛顿州西雅图，在全球各地设有开发、制造和行政办事处。\nF5最初提供基于负载均衡的产品，但此后该公司的产品线扩展至应用加速、应用安全和阻断服务攻击防御等领域。\n该公司的竞争对手有思杰系统和Radware。 ', '2022-04-14 22:45:13'),
	(189, 'FIS', '', 'Information Technology Services', 'Technology', '', '2022-04-14 22:45:32'),
	(190, 'FISV', 'Fiserv', 'Information Technology Services', 'Technology', 'Fiserv, Inc.是美国一家金融数据服务公司，为各大银行、信用社和金融公司提供服务。它是美国最大的金融数据服务公司之一。\n该公司成立于1984年7月31日，由Sunshine State Systems和First Data Processing合并而成，1986年上市。\n2019年1月17日Fiserv以换股方式，斥资220亿美元收购支付服务商First Data，合并后Fiserv原股东将占新公司57.5%权益，First Data股东则占其余42.5%权益 ', '2022-04-14 22:45:47'),
	(191, 'FITB', '五三银行', 'Banks—Regional', 'Financial Services', '五三银行是美国的一家银行，总部位于美国俄亥俄州辛辛那提市的五三银行中心。它是银行控股公司五三银行集团的一个主要子公司。目前五三银行拥有1154家支行以及2469台自动提款机，业务范围包括美国俄亥俄、肯塔基、印第安纳、密歇根、伊利诺伊、佛罗里达、田纳西、西弗吉尼亚、佐治亚以及北卡罗莱纳州。该银行亦拥有支付服务提供商Worldpay 4.5%的股权。\n五三银行在财富美国500强中排名第366位，银行名称中的“五三”源于它的两个前身公司。1908年第三国家银行和第五国家银行合并，成为辛辛那提五三国家银行。 ', '2022-04-14 22:46:05'),
