	(196, 'FOX', '福斯公司', 'Broadcasting', 'Communication Services', '福斯公司，由迪士尼收购21世纪福斯资产后，收购协议以外的部分组成。 该公司于2019年3月19日开始股票交易。\n福斯公司是21世纪福斯公司的合法继承者主要经营电视广播、新闻和体育直播。其姐妹公司新闻集团，持有默多克的报纸股份以及澳大利亚的其他媒体资产。 默多克为联合执行董事长，他的儿子拉克兰·默多克是董事长兼首席执行官。\n福斯的资产包括福斯广播公司、福斯电视台、福斯新闻、福斯财经网以及本土运营的福斯体育等。 ', '2022-04-14 22:47:21'),
	(197, 'FOXA', '福斯公司', 'Broadcasting', 'Communication Services', '福斯公司，由迪士尼收购21世纪福斯资产后，收购协议以外的部分组成。 该公司于2019年3月19日开始股票交易。\n福斯公司是21世纪福斯公司的合法继承者主要经营电视广播、新闻和体育直播。其姐妹公司新闻集团，持有默多克的报纸股份以及澳大利亚的其他媒体资产。 默多克为联合执行董事长，他的儿子拉克兰·默多克是董事长兼首席执行官。\n福斯的资产包括福斯广播公司、福斯电视台、福斯新闻、福斯财经网以及本土运营的福斯体育等。 ', '2022-04-14 22:47:35'),
