	(201, 'FTNT', 'Fortinet', 'Software—Infrastructure', 'Technology', 'Fortinet is an American multinational corporation headquartered in Sunnyvale, California. It develops and sells cybersecurity solutions, such as physical firewalls, antivirus software, intrusion prevention systems, and endpoint security components.\nBrothers Ken Xie and Michael Xie founded Fortinet in 2000. The company&#39;s first and main product was FortiGate, a physical firewall. The company later added wireless access points, sandbox, and messaging security. The company went public in November 2009. ', '2022-04-14 22:48:37'),
