	(205, 'GILD', '吉利德科学', 'Drug Manufacturers—General', 'Healthcare', '吉利德科学公司，或译吉立亚科学，是一家美国大型生物制药公司，成立于1987年，总部位于加州旧金山湾区的福斯特城。在台湾注册的名称为“吉立亚”。主要生产和研发针对艾滋病、乙型肝炎、丙型肝炎和各类传染病的药物。 ', '2022-04-14 22:49:34'),
