	(210, 'GOOG', 'Alphabet', 'Internet Content & Information', 'Communication Services', 'Alphabet公司，意思为字母表，或译为字母控股，是位于美国加州的控股公司，于2015年10月2日成立，由Google公司组织分割而来，并继承了Google公司的上市公司地位以及股票代号。Google公司重整后则成为Alphabet Inc.最大的子公司。Alphabet旗下拥有Calico、CapitalG、Chronicle、DeepMind、Google、Google Fiber、GV、Jigsaw、Loon LCC、Sidewalk Labs、Verily、Waymo 和 X 等子公司。 ', '2022-04-14 22:50:51'),
