	(219, 'HAS', '孩之宝', 'Leisure', 'Consumer Cyclical', '孩之宝公司，简称孩之宝，是一家美国的跨国玩具和棋类游戏公司。孩之宝还与探索传播联手推出电视节目以推广其产品。 公司总部位于罗德岛州的波塔基特。 其大部分产品在东亚地区制造。其著名产品有地产大亨、龙与地下城等。 ', '2022-04-14 22:53:06'),
	(220, 'HBAN', '亨廷顿银行', 'Banks—Regional', 'Financial Services', 'Huntington Bancshares Incorporated is an American bank holding company headquartered in Columbus, Ohio. The company is ranked 500th on the Fortune 500, and is 35th on the list of largest banks in the United States.\nThe company&#39;s banking subsidiary, The Huntington National Bank, operates 920 banking offices, primarily in the Midwest: 459 in Ohio, 290 in Michigan, 51 in Pennsylvania, 45 in Indiana, 35 in Illinois, 29 in West Virginia,10 in Kentucky and, 32 in Colorado. In January 2009, the bank&#39;s Board of Directors named Steve Steinour as president, CEO, and chairman, succeeding Thomas Hoaglan, who retired after eight years in those positions.\nThe company is the second-largest originator of Small Business Administration loans. ', '2022-04-14 22:53:19'),
