	(231, 'HON', '霍尼韦尔', 'Conglomerates', 'Industrials', '霍尼韦尔国际，是美国一家以电子消费品生产、工程技术服务和航空航天系统为主的跨国性公司，总部位于北卡罗来纳州夏洛特。名列《财富》杂志100强公司，拥有约110,000名雇员，其中约44,000名在美国。\n霍尼韦尔公司由马克·C·霍尼韦尔于1906年创立于二战期间通过生产航空产品进入防务工业。特殊材料业务可以追溯到1870年由化学家William H. Nichols创办的一家小公司。1999年与联合信号公司合并为现今霍尼韦尔国际。尽管联合信号是承继法人、规模是霍尼韦尔的两倍，但公司的名称依然使用霍尼韦尔，因为这有更好的品牌认知度。另外一方面，霍尼韦尔将总部合并到联合信号位于新泽西州莫里斯敦的总部。因此，霍尼韦尔前总部所在地有一千多人失业。一小部分人迁到新总部工作，而绝大部分则不得不寻找新工作或者退休。所以，合并不久，公司的股票大跌，到2007年才回到了合并前的水准。 ', '2022-04-14 22:56:11'),
