	(236, 'HSIC', '汉瑞祥', 'Medical Distribution', 'Healthcare', '汉瑞祥公司是一家总部位于美国的医疗保健产品与服务经销商，业务遍及全球34个国家或地区。 汉瑞祥公司是《财富》杂志所评选的“全球最受赞赏公司”，其社会责任等项目位居业界第一。 截至2017年，汉瑞祥公司连续六次被道德村协会评选为全球最具商业道德的公司。 ', '2022-04-14 22:57:30'),
