	(243, 'IDXX', '爱德士', 'Diagnostics & Research', 'Healthcare', '爱德士生物科技公司是一家美国医药公司，主要生产治疗各种动物疾病的药物，也提供水质检测等服务。该公司成立于1983年，当时称“AgriTech Systems”，并于1991年在纳斯达克上市。公司总部位于缅因州韦斯特布鲁克，但在全球170多个国家都有提供服务。 ', '2022-04-14 22:59:15'),
