	(246, 'ILMN', 'Illumina', 'Diagnostics & Research', 'Healthcare', 'Illumina是美国的一家生物科技公司，成立于1998年，总部设于加利福尼亚州圣地亚哥。它在巴西、英国、荷兰、中国、新加坡、日本、澳大利亚也设有分部。其员工超过3000人，2013年总收入达14.2亿。该公司专注于生物信息分析，提供有关SNP基因分型、拷贝数变异、基因组测序、DNA甲基化研究、转录组分析、基因表达谱分析相关的服务。如今的Illumina已经占有了基因组测序领域70%的市场份额，在2014年还被《MIT技术评论》选为年度50家最聪明公司第一位。 ', '2022-04-14 22:59:56'),
	(247, 'INCY', '因赛特', 'Biotechnology', 'Healthcare', '因赛特，又译英赛德，是一家美国制药公司。 ', '2022-04-14 23:00:09'),
	(248, 'INFO', '', '', '', '', '2022-04-14 23:00:22'),
	(249, 'INTC', '英特尔', 'Semiconductors', 'Technology', '英特尔是世界上第二大的半导体公司，也是首家推出x86架构中央处理器的公司，总部位于美国加利福尼亚州圣克拉拉。由罗伯特·诺伊斯、高登·摩尔、安迪·葛洛夫，以“集成电子”之名在1968年7月18日共同创办公司，将高端芯片设计能力与领导业界的制造能力结合在一起。英特尔也有开发主板芯片组、网卡、闪存、绘图芯片、嵌入式处理器，与对通信与运算相关的产品等。“Intel Inside”的广告标语与Pentium系列处理器在1990年代间非常成功地打响英特尔的品牌名号。\n英特尔早期在开发SRAM与DRAM的存储器芯片，在1990年代之前这些存储器芯片是英特尔的主要业务。在1990年代时，英特尔做了相当大的投资在新的微处理器设计上与培养快速崛起的PC工业。在这段期间英特尔成为PC微处理器的供应领导者，而且市场定位具有相当大的攻势与有时令人争议的营销策略，就像是微软公司一样支配着PC工业的发展方向。而Millward Brown Optimor发表的2007年在世界上最强大的品牌排名显示出英特尔的品牌价值由第15名掉落了10个名次到第25名。而主要竞争对手有Apple、AMD、NVIDIA、三星电子及TSMC。 ', '2022-04-14 23:00:37'),
	(250, 'INTU', 'Intuit', 'Software—Application', 'Technology', 'Intuit Inc.是一家总部位于美国加利福尼亚州山景城的跨国计算机软件公司，主要制作金融和退税相关的软件。 其较著名的产品包括Quicken、TurboTax和QuickBooks。 ', '2022-04-14 23:00:53'),
