	(253, 'IPGP', 'IPG Photonics Corporation', 'Semiconductor Equipment & Materials', 'Technology', 'IPG Photonics is a manufacturer of fiber lasers. IPG Photonics developed and commercialized optical fiber lasers, which are used in a variety of applications including materials processing, medical applications and telecommunications. IPG has manufacturing facilities in the United States, Germany, Russia and Italy.\nIPG was founded in 1990 by Valentin P. Gapontsev, IPG&#39;s Executive Chairman and former Chief Executive Officer, and Igor Samartsev, IPG&#39;s Chief Technology Officer.\nIPG also develops and manufactures fiber amplifiers, diode lasers and several complementary products used with its lasers, such as optical delivery cables, fiber couplers, and beam switches. Its products are sold globally and primarily used for materials processing, advanced technologies, telecommunications, and medical applications.\nThe company is headquartered in Oxford, Massachusetts, with more than 25 facilities around the world. ', '2022-04-14 23:01:39'),
