	(257, 'ISRG', '直觉手术', 'Medical Instruments & Supplies', 'Healthcare', '直觉手术公司，或称直觉外科公司，是一家美国医疗设备公司，主要研究机器人辅助微创手术技术，著名产品为达芬奇外科手术系统。\n该公司研发的达芬奇手术机器人主要用于前列腺切除术、心脏瓣膜修复和妇产科手术。 ', '2022-04-14 23:02:42'),
