	(273, 'KHC', '卡夫亨氏', 'Packaged Foods', 'Consumer Defensive', '卡夫亨氏是美国一家食品公司，成立于2015年，由卡夫食品及亨氏合并所成立，主要透过旗下子公司在北美及国际市场经营食品及饮料业务，提供各式食品及饮料，包含起司、肉制品、饮料、咖啡、包装正餐、冷藏餐点、坚果零食、番茄酱与各式调味品及酱料、冷冻食品、汤品、豆类和面食餐点、婴儿食品等，为全球第五大及北美第三大的食品饮料厂商。\n截至2016年12月底，沃伦·巴菲特旗下的伯克希尔·哈撒韦公司持有卡夫亨氏26.8%股权、3.3亿股，是持股量最多的机构投资者。 ', '2022-04-14 23:06:27'),
	(274, 'KIM', '', 'REIT—Retail', 'Real Estate', '', '2022-04-14 23:06:42'),
	(275, 'KLAC', '科磊', 'Semiconductor Equipment & Materials', 'Technology', '科磊 是一家美国公司，提供半导体制造相关的制程控管、良率管理服务。\n该公司是1997年由KLA和Tencor两家公司合并形成的，前者成立于1975年，后者成立于1977年。合并后称为KLA-Tencor，2019年1月10日宣布改名为KLA。改名在2019年7月正式生效。\n据 Bloomberg数据，2018年全球五大半导体设备制造商分别为应用材料、艾司摩尔、东京威力科创、科林研发、科磊，这五大半导体制造商在2018年以其领先的技术、强大的资金支持占据着全球半导体设备制造业超过70%的份额。 ', '2022-04-14 23:06:57'),
