	(285, 'LBTYA', '自由全球', 'Entertainment', 'Communication Services', '自由全球是一家总部位于美国的跨国电信公司。2005年由自由传媒集团并购UGC形成。创始之初就在全球18个国家为2300多万户居民提供宽带服务，是世界最大的宽带提供商之一。2013年6月，斥资240亿美元收购英国维珍媒体，从而进入欧洲市场。\n2018年5月9日沃达丰以184亿欧元现金收购自由全球在德国、捷克、匈牙利和罗马尼亚的业务。\n2019年2月28日，自由全球以63亿瑞士法郎的价格将其瑞士分支UPC Switzerland卖给了瑞士sunrise comms 。此交易已暂停。\n2020年5月自由全球旗下维珍媒体与西班牙电信旗下的英国行动电信业者O2，以50:50的比例合并。2021年6月1日完成。 ', '2022-04-14 23:09:21'),
