	(308, 'MAR', '万豪国际', 'Lodging', 'Consumer Cyclical', '万豪酒店集团是一家跨国的酒店管理公司，之前在纽约证券交易所上市，2014年年初改为纳斯达克。酒店集团由J. Willard Marriott创立，现业务在全球超过110个地区，管理7642家酒店，1423044间客房。总部位于美国马里兰州，员工15万人。 ', '2022-04-14 23:15:02'),
