	(311, 'MCHP', '微芯科技', 'Semiconductors', 'Technology', '微芯科技股份有限公司，是一个美国微控制器、存储器与模拟半导体制造商。它的产品包含微控制器、序列式EEPROM、序列式SRAM、KEELOQ组件、无线电频率组件、热组件、功率与电池管理模拟组件，也有线性、接口与混合信号组件。还有一些接口组件包含USB、ZigBee/MiWi，CANbus与Ethernet。\n公司总部位于亚利桑那州钱德勒，晶圆厂则分别位于亚利桑那州坦佩及俄勒冈州格雷斯罕。\n主要的竞争者有亚德诺半导体、爱特梅尔、飞思卡尔、英飞凌、美信集成产品、恩智浦半导体、瑞萨电子、意法半导体与德州仪器。 ', '2022-04-14 23:15:51'),
