	(321, 'MKTX', 'MarketAxess', 'Capital Markets', 'Financial Services', 'MarketAxess Holdings Inc.是一家国际金融科技公司，在美国纳斯达克上市，主营业务是提供金融机构使用的债券电子竞价交易平台，同时也提供市场数据，以及交易后服务。在MarketAxess的竞价交易平台上，机构投资者与做市商可以交易多种固定收益产品，主要包括公司债，国债，新兴市场债券等。\nMarketAxess创立于2000年，Richard McVey是公司的创始人，也是公司现任董事长与首席执行官。 MarketAxess总部在纽约，公司员工454人，在纽约，伦敦，阿姆斯特丹，圣保罗，香港，新加坡均有办公室。至2018年，MarketAxess在美国公司债电子交易市场份额约为85%，占全美公司债券交易总量的20%。2019年7月，公司被标准普尔500指数纳入。按照GICS全球行业分类标准，MarketAxess属于金融行业，金融交易所&amp;数据供应商子行业。 ', '2022-04-14 23:18:21'),
