	(333, 'MSFT', '微软', 'Software—Infrastructure', 'Technology', '微软是美国的一家跨国电脑科技公司，公司于1975年由比尔·盖茨与保罗·艾伦创立，以研发、制造、授权及提供广泛的电脑软件服务为主。坐标47.642229°N 122.136934°W。总部位于美国华盛顿州的雷德蒙德，最为著名及畅销的产品是Microsoft Windows操作系统及Microsoft Office办公室软件，以及Xbox游戏业务与动视暴雪。\n初期主要为Altair 8800发展和销售BASIC解释器，在1980年代中期凭借MS-DOS在家用电脑操作系统市场上获取长足进步，后来出现的Windows使得微软逐渐统治了家用桌面电脑操作系统市场。同时微软也开始扩张业务，进军其他行业和市场，创建了MSN网站，在电脑硬件市场上，微软商标及Xbox游戏机、Zune和MSN TV家庭娱乐设备也在不同的年份出现在市场上。微软于1986年首次公开募股，此后不断走高的股价为微软缔造了四位亿万富翁和12,000位百万富翁。\n伴随公司的强大，微软也受到越来越多的批评和指责，并且数十年来从未间断。拒绝交易和捆绑销售等做法招致垄断和不正当竞争的诉讼。美国司法部和欧盟委员会根据反托拉斯法均对微软做出过不利裁定。\n截至2015年，尽管在Android 和 iOS 的竞争下，微软已经失去了绝大部分移动设备系统占比，但在IBM PC 兼容操作系统市场和办公软件套装市场仍占据主导地位。该公司还为台式机，笔记本电脑，标签，小工具和服务器生产各种其他消费者和企业软件，包括互联网搜索，数位服务市场，混合现实，云计算和软件开发。\n斯蒂弗鲍尔默于2000年取代盖茨担任首席执行官，后来设想了“设备和服务”战略。随着微软在2008年收购Danger 公司，于2012年6月首次进入个人电脑生产市场，随着微软Surface 系列平板电脑的推出，以及随后通过收购诺基亚设备形成微软移动和服务部门。自萨蒂亚纳德拉于2014年接任首席执行官以来，该公司业务已多元化，除了原先的Windows 和 Office 和游戏主机业务，还发展Surface 系列和云服务，并更积极的参与开源，例如在2016年8月18日，宣布开源PowerShell，并在Windows 业务和Office 业务和Xbox 业务之外新增对Linux平台的支持，发展 WSL，开源 Windows Terminal，收购 GitHub，.NET 框架 开源并跨平台，开源 VS Code，加强发展Microsoft Azure 平台，Office 产品支持多平台。\n2018年，微软曾一度超越苹果公司，成为全球最有价值的上市公司。在2019年4月，微软达到了1兆美元的市值，成为仅次于苹果公司第二家股价市值超过1兆美元的美国上市公司。2021年6月微软市值首次突破2兆美金，成为第二家市值突破2兆美金的公司。 ', '2022-04-14 23:21:41'),
