	(337, 'MU', '美光科技', 'Semiconductors', 'Technology', '美光科技公司，简称美光科技，是美国一家总部位于爱达荷州波夕的半导体制造公司，于1978年由Ward Parkinson、Joe Parkinson、Dennis Wilson和Doug Pitman创立。其主要业务为生产多种形式的半导体器件，包括动态随机存取存储器，闪存和固态驱动器；其主要产品包括DRAM、NAND快闪存储器、CMOS影像感测器、其它半导体元件和内存模组。 ', '2022-04-14 23:22:40'),
