	(342, 'NDAQ', '納斯達克期權經紀人公司/赫爾辛基證券交易所集團', 'Financial Data & Stock Exchanges', 'Financial Services', 'Nasdaq, Inc. is an American multinational financial services corporation that owns and operates three stock exchanges in the United States: the namesake Nasdaq stock exchange, the Philadelphia Stock Exchange, and the Boston Stock Exchange, and seven European stock exchanges: Nasdaq Copenhagen, Nasdaq Helsinki, Nasdaq Iceland, Nasdaq Riga, Nasdaq Stockholm, Nasdaq Tallinn, and Nasdaq Vilnius. It is headquartered in New York City, and its president and chief executive officer is Adena Friedman.\nHistorically, the European operations have been known by the company name OMX AB, which was created in 2003 upon a merger between OM AB and HEX plc. The operations have been part of Nasdaq, Inc. since February 2008. They are now known as Nasdaq Nordic, which provides financial services and operates marketplaces for securities in the Nordic and Baltic regions of Europe. ', '2022-04-14 23:23:48'),
