	(344, 'NEM', '', 'Gold', 'Basic Materials', '', '2022-04-14 23:25:02'),
	(345, 'NFLX', 'Netflix', 'Entertainment', 'Communication Services', 'Netflix，中文译名网飞或奈飞，是起源于美国、在多国提供网络视频点播的OTT服务公司，并同时在美国国内经营单一费率邮寄DVD出租服务，后者是使用回邮信封寄送DVD和Blu-ray出租光盘至消费者指定的收件地址。公司由里德·哈斯廷斯和马克·兰多夫在1997年8月29日成立，总部位于加利福尼亚州的洛斯盖图，1999年开始推出订阅制的服务。到了2009年，Netflix已可提供超过10万部电影DVD，订阅者数超过1000万人。另一方面，Netflix在流媒体平台上已是世界数一数二的佼佼者，截至2021年1月的数据，Netflix的流服务已经在全球拥有2.037亿个订阅用户，在美国的订户已达到7300万。其主要的竞争对手有HBO Max、Hulu、Amazon Prime Video、Disney+、YouTube Premium及Apple TV+等。\nNetflix在多个排行榜上均榜上有名：2017年6月6日，《2017年BrandZ最具价值全球品牌100强》公布，Netflix名列第92位。2018年10月，《财富》未来公司50强排行榜发布，Netflix排名第八。2018年12月，世界品牌实验室编制的《2018世界品牌500强》揭晓，排名第88。在《财富》2018年世界500大排名261位，并连年增长。2019年10月，位列2019福布斯全球数字经济100强榜第46名。2019年10月，Interbrand发布的全球品牌百强榜排名65。2020年1月22日，名列2020年《财富》全球最受赞赏公司榜单第16位。2020年7月10日，按市值计算，Netflix成为最大的媒体娱乐公司。除此之外，Netflix更于2019年加入美国电影协会。 ', '2022-04-14 23:25:17'),
