	(348, 'NLOK', '诺顿LifeLock', 'Software—Infrastructure', 'Technology', '诺顿LifeLock公司，前称赛门铁克是一家总部设于美国亚利桑那州坦佩的互联网安全技术厂商，创立于1982年3月1日，并在全球有40个国家设有分公司，在《财富》500强企业名单中名列第391位，全球拥有20,500多名员工。\n2015年8月11日，赛门铁克以80亿美元出售旗下的信息管理业务Veritas予The Carlyle Group、GIC与其他投资人共组的投资集团，于2016年1月1日完成交易。 ', '2022-04-14 23:26:16'),
