	(355, 'NTAP', 'NetApp', 'Computer Hardware', 'Technology', '网域存储公司是一间美国上市科技公司，以网络设备和服务贩卖为主。纳斯达克100，财富100强的成员，曾当选FORTUNE杂志评比美国最值得上班的公司第一名。 ', '2022-04-14 23:28:05'),
	(356, 'NTES', '网易', 'Electronic Gaming & Multimedia', 'Communication Services', '网易是一家中国大陆大型互联网科技公司。目前提供网络游戏、门户网站、移动新闻客户端、移动财经客户端、电子邮件、电子商务、搜索引擎、博客、相册、社交平台、互联网教育等服务。截至2020年1月16日，网易公司的市值为442亿美元，其收入中大约79%来自于在线游戏服务。 ', '2022-04-14 23:28:19'),
	(357, 'NTRS', '北方信托银行', 'Asset Management', 'Financial Services', '北美信托银行NASDAQ：NTRS，总部设在美国芝加哥的一家私人银行，主要提供投资管理，资产、基金管理，信托和银行服务，除了美国本土外，该公司的业务遍及加拿大及英国，是世界最大托管银行之一。资产管理规模约为1.2 万亿美元。 ', '2022-04-14 23:28:33'),
	(358, 'NUE', '', 'Steel', 'Basic Materials', '', '2022-04-14 23:28:48'),
	(359, 'NVDA', '英伟达', 'Semiconductors', 'Technology', 'NVIDIA，创立于1993年1月，是一家以设计和销售图形处理器为主的无厂半导体公司。NVIDIA亦会设计游戏机核心，例如Xbox和PlayStation。NVIDIA最出名的产品线是为个人与游戏玩家所设计的GeForce系列，为专业CGI工作站而设计的Quadro系列，以及为服务器和高效运算而设计的Tesla系列，虽然起家于PC电脑的显卡业务，英伟达也曾涉及移动芯片Tegra的设计，但智能机市场对此响应不大，不过近年却利用这些研发经验，目前朝向人工智能和机器视觉的市场发展，也是图形处理器上重要的开发工具CUDA的发明者。不过NVIDIA的发展过程也是非议不断，批评多集中于滥用排他性商业合作、不正当营销方式、对业界开放标准和自由软件运动的拒斥等。\nNVIDIA的总部设在美国加利福尼亚州的圣克拉拉位于硅谷的中心位置。 ', '2022-04-14 23:29:10'),
	(360, 'NVR', '', 'Residential Construction', 'Consumer Cyclical', '', '2022-04-14 23:29:31'),
	(361, 'NWL', '诺威品牌', 'Household & Personal Products', 'Consumer Defensive', '诺威品牌股份有限公司，简称诺威品牌及诺威品牌股份，总部位于美国佐治亚州桑迪斯普林斯，是一家全球市场营销各类产品，包括：派克、帝么、史派、纸美、屈伯德等著名品牌用品，前身“诺威屈伯德股份有限公司”。\n其企业成立于1999年，也就是由1903年于纽约成立诺威制造商公司和1933年成立的屈伯德制造公司合并而成的。股份自1972年于纳斯达克上市，其后在1979年转在纽约证券交易所上市。 ', '2022-04-14 23:29:45'),
