	(364, 'NXPI', '恩智浦半导体', 'Semiconductors', 'Technology', '恩智浦半导体，前身为飞利浦半导体，由荷兰企业飞利浦在1953年创立，公司总部位于荷兰埃因霍温。2006年8月31日，该公司首席执行官万豪敦在柏林向客户和员工宣布公司的新名称。\n恩智浦半导体目前可以提供半导体、系统和软件解决方案；使用在汽车、手机、智能识别应用、电视、机上盒以及其他电子设备上。 ', '2022-04-14 23:30:29'),
	(365, 'O', '', 'REIT—Retail', 'Real Estate', '', '2022-04-14 23:30:41'),
	(366, 'ODFL', 'Old Dominion Freight Line Inc', 'Trucking', 'Industrials', 'Old Dominion Freight Line, Inc. is an American regional, inter-regional and national less than truckload shipping company. In addition to its core LTL services, the company offers logistics and household moving services.\nThe company has five primary product groups: Domestic, Expedited, People, Global, Household Services and Technology. Global offerings include full container load and less-than-container load service to the Caribbean, Europe, the Far East, Central America and South America. The company operates more than 5,800 tractors and more than 22,500 trailers. ', '2022-04-14 23:30:53'),
