	(376, 'PCAR', '帕卡', 'Farm & Heavy Construction Machinery', 'Industrials', '帕卡是美国财富500强公司和世界最大的中型和重型卡车制造商之一，也有制造轻型和中型车辆。 PACCAR在2006年被授予美国国家技术勋章。在华盛顿州兰顿，PACCAR是仍在运营的最古老的企业。 2013年6月该厂还庆祝了它的20周年纪念日；自1993年工厂开始运作已生产了超过13辆万重型和中型Kenworth卡车。 ', '2022-04-14 23:33:44'),
