	(402, 'PYPL', 'PayPal', 'Credit Services', 'Financial Services', 'PayPal，是一个总部位于美国加利福尼亚州圣荷西市的因特网第三方支付服务商，允许在使用电子邮件来标识身份的用户之间转移资金，避免了传统的邮寄支票或者汇款的方法。PayPal也和一些电子商务网站合作，成为它们的付款方式之一；但是用这种付钱方式转账时，PayPal收取数额比例相当高昂的手续费。 ', '2022-04-14 23:39:33'),
	(403, 'QCOM', '高通', 'Semiconductors', 'Technology', '高通公司是位于美国加州圣地亚哥的无线电通信技术研发公司，由加州大学圣地亚哥分校教授厄文·马克·雅各布和安德鲁·维特比创建，于1985年成立。两人此前曾共同创立Linkabit。 ', '2022-04-14 23:39:45'),
	(404, 'QRVO', '科沃', 'Semiconductors', 'Technology', 'Qorvo is an American semiconductor company that designs, manufactures, and supplies radio-frequency systems for applications that drive wireless and broadband communications, as well as foundry services. The company, which trades on NASDAQ, was created by the merger of TriQuint Semiconductor and RF Micro Devices, which was announced in 2014 and completed on January 1, 2015. The headquarters for the company originally were in both Hillsboro, Oregon, and Greensboro, North Carolina, but in mid-2016 the company began referring to its North Carolina site as its exclusive headquarters. ', '2022-04-14 23:39:58'),
