	(407, 'REG', 'Regency Centers Corp', 'REIT—Retail', 'Real Estate', 'Regency Centers Corporation is a real estate investment trust based in Jacksonville, Florida and is one of the largest operators of shopping centers with grocery stores as anchor tenants. As of October 21, 2020, the company owned 415 properties comprising 56 million square feet of space. Notable properties owned by the company include Serramonte Center and a 30% interest in Cameron Village. ', '2022-04-14 23:40:35'),
