	(417, 'ROST', '罗斯百货', 'Apparel Retail', 'Consumer Cyclical', '罗斯百货是一家美国廉价百货公司。该公司创始于1982年，现在在美国本土和关岛运营有一千家多家百货商店。\n2014年公司总部搬到加州都柏林。2018年，该公司在财富美国500强中位列209。 ', '2022-04-14 23:43:11'),
