	(420, 'SBAC', 'SBA Communications Corporation', 'REIT—Specialty', 'Real Estate', 'SBA Communications Corporation is a real estate investment trust which owns and operates wireless infrastructure in the United States, Canada, Central America, South America, and South Africa. ', '2022-04-14 23:43:55'),
	(421, 'SBUX', '星巴克', 'Restaurants', 'Consumer Cyclical', '星巴克股份有限公司，简称星巴克，又译史塔巴克斯，是美国一家跨国连锁咖啡店，也是全球最大的连锁咖啡店，成立于1971年，发源地与总部位于美国华盛顿州西雅图。除咖啡之外，亦有茶饮等饮料，以及三明治、糕点等点心类食品。最初仅专卖咖啡豆，在转型为现行的经营型态后开始快速展店，并成为美式生活的象征之一，部分店铺甚至与超级市场、书店等异业结盟，以复合式商店经营。根据星巴克2018年报，星巴克在全球75个国家及地区皆有据点，由该公司直接营运的分店有13275间，特许经营分店更多达14064间。当中亦有不少分店的会具当地特色及找来设计师设计，如法国巴黎歌剧院店、意大利邮局宫店、日本福冈的表参道店。 ', '2022-04-14 23:44:09'),
	(422, 'SCHW', '', 'Capital Markets', 'Financial Services', '', '2022-04-14 23:44:22'),
	(423, 'SEE', '', 'Packaging & Containers', 'Consumer Cyclical', '', '2022-04-14 23:44:35'),
	(424, 'SGEN', '西雅图遗传', 'Biotechnology', 'Healthcare', 'Seagen Inc. is an American biotechnology company focused on developing and commercializing innovative, empowered monoclonal antibody-based therapies for the treatment of cancer. The company, headquartered in Bothell, Washington, is the industry leader in antibody-drug conjugates or ADCs, a technology designed to harness the targeting ability of monoclonal antibodies to deliver cell-killing agents directly to cancer cells. Antibody-drug Conjugates are intended to spare non-targeted cells and thus reduce many of the toxic effects of traditional chemotherapy, while potentially enhancing antitumor activity.\nThe company&#39;s flagship product Adcetris is commercially available for four indications in more than 65 countries, including the U.S., Canada, Japan and members of the European Union.\nTo expand on the clinical opportunities of brentuximab vedotin, Seattle Genetics is conducting a broad clinical development program\nto evaluate its therapeutic potential in earlier lines of its approved indications as well as in a range of other lymphoma and non-lymphoma settings. The company is jointly developing brentuximab vedotin in collaboration with Takeda Pharmaceutical Company. ', '2022-04-14 23:44:49'),
	(425, 'SHW', '', 'Specialty Chemicals', 'Basic Materials', '', '2022-04-14 23:45:01'),
	(426, 'SIRI', '天狼星XM', 'Broadcasting', 'Communication Services', '天狼星XM控股股份有限公司是美国一家广播公司，以卫星广播和在线广播的形式向美国听众提供三种电台广播服务，这包括：天狼星卫星电台、XM卫星电台和天狼星XM电台。同时，天狼星XM控股股份有限公司还是天狼星XM加拿大控股有限公司的次要投资方及关联公司，天狼星XM加拿大控股有限公司是一家向加拿大境内提供天狼星卫星电台和XM卫星电台服务的公司。2013年底，天狼星公司重组了公司架构，使天狼星XM电台公司成为天狼星XM控股股份有限公司的直接全资子公司。\n天狼星XM电台公司是在美国联邦通讯委员会于2008年7月29日批准天狼星卫星广播公司收购XM卫星广播控股公司后成立的，此时距离首次收购邀约已是17个月后。 根据合并之日的用户量计算，这次合并共计带来超过1,850万用户。 这次交易价值高达33亿美元，但不包含债务。 截至2017年第二季度，天狼星XM公司拥有3,200万订阅用户。\n反对合并的人认为天狼星公司与XM公司的合并将导致垄断，但是天狼星和XM却认为合并是卫星广播的唯一出路。 ', '2022-04-14 23:45:16'),
