	(440, 'STX', '希捷科技', 'Computer Hardware', 'Technology', '希捷科技是全球主要的硬盘厂商之一，于1979年在美国加州成立，现时在开曼群岛注册。现时，希捷的主要产品包括桌面硬盘、企业用硬盘、笔记本电脑硬盘和微型硬盘，它的第一个硬盘产品容量是5MB。在2006年5月，希捷科技收购了另一间硬盘厂商迈拓公司。产品销量方面，希捷宣称为销量第一的公司，售出十亿个硬盘产品。\n其硬盘检测工具名为“SeaTools”，有在线版、桌面用户版和企业版。工具可以显示出硬盘的健康状况，并告诉用家硬盘的问题所在。企业版本并不支持ATA和SATA接口，只支持SCSI和光纤接口，亦可以同时检查多个硬盘。\n其硬盘备份工具为Seagate Discwizard，基于Acronis True Image备份工具。但该软件仅支持Seagate\\Maxtor\\Samsung的硬盘。 ', '2022-04-14 23:48:30'),
