	(443, 'SWKS', '思佳', 'Semiconductors', 'Technology', 'Skyworks Solutions, Inc. is an American semiconductor company headquartered in Irvine, California, United States.\nSkyworks manufactures semiconductors for use in Radio Frequency and mobile communications systems. Its products include power amplifiers, front-end modules and RF products for handsets and wireless infrastructure equipment. The company&#39;s portfolio includes amplifiers, attenuators, circulators, demodulators, detectors, diodes, directional couplers, front-end modules, hybrids, infrastructure RF subsystems, isolators, lighting and display products, mixers, modulators, optocouplers, opto-isolators, phase shifters, PLLs/synthesizers/VCOs, power dividers/combiners, power management devices, receivers, switches and technical ceramics. ', '2022-04-14 23:49:11'),
