	(449, 'TCOM', '携程旅行网', 'Travel Services', 'Consumer Cyclical', '携程集团，简称携程或携程旅行网，是一家总部设立在上海的中国大型旅游网站，1999年创办。2003年12月，该公司在美国纳斯达克上市。目前携程已在中国大陆的北京、广州等17个城市设立分支机构，在南通设立服务联络中心，并在香港及台湾皆有旗下事业，占中国在线旅游市场份额一半以上，是中国最大的在线旅行社，也是全球最大的在线旅行社之一。携程旗下拥有携程网、去哪儿网、Skyscanner、Trip.com四个主要品牌以及驴评网、鸿鹄逸游、永安、易游等多个品牌。 ', '2022-04-14 23:50:30'),
