	(458, 'TMUS', 'T-Mobile美国', 'Telecom Services', 'Communication Services', 'T-Mobile美国是一家美国无线网络运营商，总部位于华盛顿州贝尔维尤。其最大股东分别为占43%的德国电信和占24%的软银集团。T-Mobile是美国第三大移动通信运营商，截至2021年第一季度拥有约1.034亿客户。\n2020年4月1日，T-Mobile与Sprint完成合并。8月2日，Sprint品牌结束运作。 ', '2022-04-14 23:52:26'),
	(459, 'TPR', '', 'Luxury Goods', 'Consumer Cyclical', '', '2022-04-14 23:52:38'),
	(460, 'TROW', '普徕仕', 'Asset Management', 'Financial Services', '普徕仕是一家美国投资管理上市公司，为个人、机构和金融中介机构提供共同基金、咨询、账户管理、退休金等金融服务。截至2020 年，该公司在财富美国500强中名列第447位。\n该公司总部位于马里兰州巴尔的摩。该公司由Thomas Rowe Price, Jr.于1937年创立。 ', '2022-04-14 23:52:51'),
	(461, 'TRV', '', 'Insurance—Property & Casualty', 'Financial Services', '', '2022-04-14 23:53:04'),
	(462, 'TSCO', '牵引机供应公司', 'Specialty Retail', 'Consumer Cyclical', '牵引机供应公司是一家美国杂货零售商，是美国最大的杂货零售商之一。\n1938年该公司成立，当时是经营牵引机部件销售生意，后来经营范围逐渐扩大，形成了现在的规模，在美国49个州拥有约1,700家商店。 ', '2022-04-14 23:53:17'),
	(463, 'TSLA', '特斯拉', 'Auto Manufacturers', 'Consumer Cyclical', '特斯拉科技，改名前称为特斯拉汽车，是美国最大的电动汽车及太阳能板公司，并与松下合作电池业务，产销电动汽车、车载计算机，太阳能板及储能设备与系统解决方案。特斯拉是世界上最早的自动驾驶汽车生产商，至2018年，特斯拉汽车已经成为世界最畅销充电式汽车公司。2021年10月，成为第六家市值破1兆美元的巨头企业。\n2021年Q1财报公布，特斯拉卖掉公司持有的10%比特币，以证明加密货币作为现金替代物的流动性，公司剩下价值13亿的比特币，获利1亿美金。 ', '2022-04-14 23:53:29'),
	(464, 'TSN', '', 'Farm Products', 'Consumer Defensive', '', '2022-04-14 23:53:42'),
	(465, 'TT', '', 'Specialty Industrial Machinery', 'Industrials', '', '2022-04-14 23:53:56'),
	(466, 'TTWO', 'Take-Two Interactive', 'Electronic Gaming & Multimedia', 'Communication Services', 'Take-Two Interactive是一家美国主要的游戏开发与发行商，同时他也是电玩游戏与周边设备的经销商，旗下有2K和Rockstar Games，其中2K品牌包括发行核心游戏的2K Games、发行休闲益智类游戏的2K Play以及发行体育竞技类游戏的2K Sports。公司总部位于纽约而国际总部则是为于英国温莎。开发工作室遍及了许多地方，包括圣迭戈、温哥华、多伦多以及诺瓦托。 ', '2022-04-14 23:54:09'),
	(467, 'TWTR', '', 'Internet Content & Information', 'Communication Services', '', '2022-04-14 23:54:22'),
	(468, 'TXN', '德州仪器', 'Semiconductors', 'Technology', '德州仪器是一家位于美国德克萨斯州达拉斯的跨国公司，以开发、制造、销售半导体和计算器技术闻名于世，主要从事数字信号处理与模拟电路方面的研究、制造和销售。它在25个国家有制造、设计或者销售机构。根据2021年IC Insights统计，德州仪器是世界第九大半导体制造商；曾经是移动电话的第二大芯片供应商，仅次于高通；同时也是在世界范围内的第一大数字信号处理器和模拟半导体组件的制造商，其产品还包括计算器、微控制器以及多核处理器。德州仪器居世界半导体公司20强。\n德州仪器于1951年创建。它由地球物理业务公司整组而产生。这家公司最初生产地震工业和国防电子的相关设备。TI于20世纪50年代初开始研究晶体管，同时也制造了世界上第一个商用硅晶体管。1954年，TI研发制造了第一台晶体管收音机，1958年，在TI中新研究实验室工作的Jack Kilby杰克·基尔比发明了集成电路。1961年，TI为美国空军制造了第一台集成电路电脑。50年代末期，TI开始研究红外线技术，随后TI涉足制造导弹和炸弹的雷达系统，导航和控制系统。世界上第一台便携式计算器由TI于1967年发明。\n20世纪70、80年代公司业务集中于家用电子产品，如数字钟表、电子手表、便携式计算器、家用电脑以及各种传感器。1997年公司将其国防业务出售给了美国雷神公司。2007年，德州仪器被认为是世界上最大的道德企业之一。\n2011年收购美国国家半导体之后，TI拥有由约45000种模拟电路产品及客户设计工具组成的投资组合，这使TI成为世界上最大模拟电路元器件生产厂商。2011年TI在财富500强中位列第175名。TI旗下业务有两个主要分支：半导体和教育技术，其中半导体业务创造了公司收益的约96%。 ', '2022-04-14 23:54:36'),
	(469, 'TXT', '', 'Aerospace & Defense', 'Industrials', '', '2022-04-14 23:54:48'),
