	(471, 'UAA', '', 'Apparel Manufacturing', 'Consumer Cyclical', '', '2022-04-14 23:55:13'),
	(472, 'UAL', '联合大陆控股', 'Airlines', 'Industrials', 'United Airlines Holdings, Inc. is a publicly traded airline holding company headquartered in the Willis Tower in Chicago. UAH owns and operates United Airlines, Inc.\nUAL Corporation agreed to change its name to United Continental Holdings in May 2010, when an agreement was reached between United and Continental Airlines where United would acquire Continental. To effect the acquisition, Continental shareholders received 1.05 shares of UAL stock for each Continental share; at the time of closing, it was estimated that United shareholders owned 55% of the merged entity and Continental shareholders owned 45%. The company or its subsidiary airlines also have several other subsidiaries. Once completely combined, United became the world&#39;s largest airline, as measured by revenue passenger miles. United is a founding member of the Star Alliance.\nUAH has major operations at Chicago–O&#39;Hare, Denver, Guam, Houston–Intercontinental, Los Angeles, Newark, San Francisco, and Washington–Dulles. Additionally, UAH&#39;s United is the largest U.S. carrier to the People&#39;s Republic of China and maintains a large operation throughout Asia. ', '2022-04-14 23:55:25'),
