	(489, 'VRSK', '威瑞斯克分析', 'Consulting Services', 'Industrials', 'Verisk Analytics, Inc. is an American multinational data analytics and risk assessment firm based in Jersey City, New Jersey, with customers in insurance, natural resources, financial services, government, and risk management sectors. The company uses proprietary data sets and industry expertise to provide predictive analytics and decision support consultations in areas including fraud prevention, actuarial science, insurance coverage, fire protection, catastrophe and weather risk, and data management.\nThe company was privately held until its October 6, 2009 initial public offering, which raised $1.9 billion for several of the large insurance companies that were its primary shareholders, making it the largest IPO in the United States for the year 2009. The firm did not raise any funds for itself in the IPO, which was designed to provide an opportunity for the firm&#39;s casualty and property insurer owners to sell some or all of their holdings and to provide a market price for those retaining their shares. ', '2022-04-14 23:59:11'),
	(490, 'VRSN', '威瑞信', 'Software—Infrastructure', 'Technology', '威瑞信是美国一家专注于多种网络基础服务的上市公司，位于弗吉尼亚州赖斯顿。该公司将他们的业务统称为“智能基础设施服务”。\nVeriSign的主要业务有管理世界13台根服务器中的2台，.com、.net和.name通用顶级域名以及.cc和.tv国家代码顶级域名的注册，还包括.jobs、.gov和.edu顶级域名后端系统的运营。北美最大的SS7信号网络中的一个、EPCglobal委托的射频识别目录。除外，还提供一系列的安全服务，包括管理型DNS服务、分布式拒绝服务的防御，以及网络威胁报告。\n此外，VeriSign因为拥有多项安全技术，所以也提供电子证书、付款处理等安全服务，还有手机漫游、移动设备的数字内容下载、免付费电话数据库查询等防火墙的管理也是VeriSign的经营项目。\nVeriSign由公开密钥加密技术先锋RSA.com于1995年脱离出来。\n2010年，威瑞信将其认证业务以12.8亿美元的价格出售给赛门铁克公司，其中包括SSL认证服务、公钥基础设施服务、威瑞信信任印章，以及威瑞信身份保护认证服务。\n威瑞信的前任首席财务官Brian Robins在2010年8月宣布，由于公司95%的业务都在东海岸，因此公司会在2011年从原来的总址加州山景城迁移至北弗吉尼亚州的杜勒斯。\n2014年初，美国政府宣布将“放弃对互联网域名命名系统的监管给非政府实体”，使Verisign的股价大幅下挫。最终，ICANN选择继续选择VeriSign作为根域维护者的角色，并且两者在2016年签订了新合同。 ', '2022-04-14 23:59:23'),
