	(496, 'WBA', '沃尔格林联合博姿', 'Pharmaceutical Retailers', 'Healthcare', '沃尔格林联合博姿是一家由沃尔格林和联合博姿合并形成的控股公司，其下包含沃尔格林、博姿和其他一些制药、药品销售公司。沃尔格林在2014年12月31日用49亿美元现金和价值107亿美元的普通股买下联合博姿。合并后联合博姿已不存在，而沃尔格林仍为其旗下子公司。同日，该公司在纳斯达克上市。 ', '2022-04-15 00:00:46'),
	(497, 'WDAY', 'Workday', 'Software—Application', 'Technology', 'Workday是美国一家云端财务管理和人力资本管理软件厂商。Workday是在2005年甲骨文公司收购ERP公司仁科公司之后，由仁科公司的创始人和前首席执行官David Duffield和前仁科公司首席战略师Aneel Bhusri所创立。2012年10月，Workday进行首次公开募股。2017年12月18日，Workday获纳入纳斯达克100指数成份股。 ', '2022-04-15 00:00:58'),
	(498, 'WDC', '西部数据', 'Computer Hardware', 'Technology', '西部数据，简称WD、西数或威腾，是美国一家专门研发和生产电脑机械硬盘的公司，在购买闪迪成为母公司后，在集成电路和固态硬盘上也占有一席之地，资料存储方面拥有悠长的经验。 ', '2022-04-15 00:01:11'),
