	(512, 'WYNN', '永利度假村', 'Resorts & Casinos', 'Consumer Cyclical', '永利度假村有限公司，简称永利度假村，于2002年10月25日，由梦幻度假村集团前主席及首席执行官史提芬·艾伦·永利，于现时总部内华达州天堂市设立。\n主要经营开发和营运高档酒店和赌场，直至2013年止，已发展了4个物业。\n2000年，史提芬·艾伦·永利同意把旗下梦幻度假村集团出售给美高梅国际酒店集团，而上述为1973年创立。而同一期内，以2.7亿美元收购沙漠假日客栈。\n该公司和宇宙娱乐公司创办人兼日本亿万富豪冈田和生为生意拍档，合组为美国宇宙博彩公司，每股权差不多各占一半以上。\n2002年，该公司聘请投资银行家Ronald Kramer为委任为董事兼总裁，主要负责筹备上市招股等事项。\n该公司进行公开招股，在2002年10月25日于纳斯达克上市。\n首批工程项目，是永利拉斯维加斯于2005年4月28日开业。\n该公司进行在2004年6月28日，第二建设项目，永利澳门于2006年9月25日开业。\n2006年4月28日，安可拉斯维加斯为了庆祝永利拉斯维加斯成立一周年举行了第二栋饭店大楼的动土典礼，而主席史提芬·永利也公布重建永利拉斯维加斯高尔夫球场，名为永利乡村俱乐部。而原本2009年前动工的“永利百汇”，把人工湖一分为二，也因为种种问题而胎死腹中。\n永利安可，则在2010年4月21日，于澳门的永利澳门场内进行第二项目开始。\n2016年8月22日，位于澳门路氹城的永利皇宫正式开幕。\n2018年2月7日，史提芬·艾伦·永利因性骚扰丑闻辞去公司职务。\n2018年3月23日，银河娱乐以9亿2750万美元，收购530万股永利渡假村的新股，占永利已发行股本约百分之4.9，每股作价175美元。\n截至2020年，永利度假村公司已开发了六处物业。最值得注意的是，其旗舰永利拉斯维加斯和安可拉斯维加斯分别在2020年《福布斯旅游指南》星级评定中获得五星级荣誉，现在分别是世界上最大和第二大的FTG五星级度假村。永利皇宫原为2018年获得FTG五星级殊荣，是第三大。 ', '2022-04-15 00:04:15'),
	(513, 'XEL', 'Xcel能源公司', 'Utilities—Regulated Electric', 'Utilities', 'Xcel Energy Inc. is an American utility holding company based in Minneapolis, Minnesota, serving more than 3.7 million electric customers and 2.1 million natural gas customers in Minnesota, Michigan, Wisconsin, North Dakota, South Dakota, Colorado, Texas, and New Mexico in 2019. It consists of four operating subsidiaries: Northern States Power-Minnesota, Northern States Power-Wisconsin, Public Service Company of Colorado, and Southwestern Public Service Co.\nIn December 2018, Xcel Energy announced it would deliver 100 percent clean, carbon-free electricity by 2050, with an 80 percent carbon reduction by 2035. This makes Xcel the first major US utility to set such a goal. ', '2022-04-15 00:04:30'),
	(514, 'XLNX', '', '', '', '', '2022-04-15 00:04:42'),
	(515, 'XOM', '', 'Oil & Gas Integrated', 'Energy', '', '2022-04-15 00:04:54'),
	(516, 'XRAY', '登士派', 'Medical Instruments & Supplies', 'Healthcare', 'Dentsply Sirona is an American dental equipment manufacturer and dental consumables producer that markets its products in over 120 countries. It has factories in 21 countries. The present company is largely the result of a merger in 1993 in which Gendex Corporation acquired Dentsply International Inc. for $590 million.\nAs an equipment maker, it designs and manufactures laboratory and specialty products relating to dental supplies. With regards to consumable products, it specializes in anesthetics, plaque and gum disease prevention and tooth polishers. It also designs and constructs artificial teeth. It has also been cited as a key player in the future-intra oral flat panel sensor market. Because of the income disparity between wealthy and developing nations, the variety of products in demand differs from region to region.\nOn January 17, 2018, Dentsply Sirona announced the appointment of Donald M. Casey Jr., formerly CEO of the Medical Segment of Cardinal Health, as CEO and a member of the board.\nIn 2018 a Netherlands-based certification company awarded Dentsply the “Top Employer” certification. ', '2022-04-15 00:05:07'),
	(517, 'XRX', '施乐', 'Information Technology Services', 'Technology', '施乐公司，台湾称为全录，是一家美国文案管理、处理技术公司，产品包括打印机、复印机、数字印刷设备以及相关的服务和耗材供应。施乐公司的总部位于美国康涅狄格州弗雷菲尔德县诺沃克。纽约州罗切斯特是施乐公司的诞生地，现在仍是施乐公司最主要的办公地点。\n由于施乐在办公室光学设备、尤其是复印机方面的成功，在美式英语甚至有将其品牌名称“xerox”直接当作“复印”的动词或名词之代用词的非正式习惯。此外现在电脑中随处可见的图型化接口也是由施乐公司和旗下的帕罗奥多研究中心发明的。 ', '2022-04-15 00:05:19'),
