	(521, 'ZBRA', '斑马技术公司', 'Communication Equipment', 'Technology', '斑马技术是一家位于美国伊利诺伊州在纳斯达克上市的计算机外设制造公司。主要从事票据、条码标签打印机、RFID智能标签打印机、固定或手持读码器。\n全世界170多个国家或地区，世界500强企业超过90%都在使用斑马打印机。 ', '2022-04-15 00:06:09'),
	(522, 'ZION', '齐昂银行', 'Banks—Regional', 'Financial Services', 'Zions Bancorporation is a bank holding company headquartered in Salt Lake City, Utah. Zions Bancorporation originated as Keystone Insurance and Investment Co., a Utah Corporation, in April 1955. In April 1960, Keystone, together with several individual investors, acquired a 57.5 percent interest in Zions First National Bank from The Church of Jesus Christ of Latter-day Saints. In 1965, the name of the company was changed to Zions Bancorporation. The first public offering of shares in Zions Bancorporation was made in January 1966. There continued to be some minority shareholders until April 1972, when the company exchanged the remaining minority shares for common shares. In 2018, Zions Bancorporation merged into its bank subsidiary, ZB, N.A., which was then renamed Zions Bancorporation, N.A. Zions Bancorporation now operates as a national bank doing business under eight local brands, rather than as a holding company. ', '2022-04-15 00:06:23'),
	(523, 'ZTS', '', 'Drug Manufacturers—Specialty & Generic', 'Healthcare', '', '2022-04-15 00:06:36');
